import Model from '../Models/Models.js'

class APIService extends Model{
    GetVessels = (callback) => {
        super.get("/vessels", {} , (vessels, error) => {
            if (error == null) {
                callback(vessels)
            }
            callback([])
        })
    }
}
export default APIService;
